app_privacy_policy:
{"data_shared" : "some information from your browser may automatically be sent to the other company when you interact with buttons, tools, or content from other companies in Adobe Services and Software. reCAPTCHA Enterprise collects hardware and software information, and sends it to Google for purposes of providing, maintaining, and improving reCAPTCHA Enterprise and for general security purposes. Adobe shares contact and identifier information about you from your social networking account when you sign into some Adobe Services and Software using a social networking account. Adobe also shares information which you have made publicly available on your social networking account when you interact with Adobe’s social networking pages.", 

"data_collected": "Adobe may collect information about your use of features in Adobe Services and Software that link to other companies’ services. This includes content “liked” and address information in Google Maps. reCAPTCHA Enterprise collects hardware and software information. Adobe receives contact and identifier information about you from your social networking account when you sign into some Adobe Services and Software using a social networking account. Adobe collects information which you have made publicly available on your social networking account when you interact with Adobe’s social networking pages. Biometric identifiers or biometric information may be collected when you use certain features of Adobe Services and Software. When you visit an Adobe office, Adobe collects Identifiers and Contact information such as your name, company name, and email address; and Audio, electronic, visual, or similar information.", 

"security_practices" : "Adobe websites may implement Google reCAPTCHA Enterprise to help prevent spam and abuse. Adobe practices with respect to social networking pages and account sign-on services. Adobe follows the practice of deleting biometric identifiers or biometric information once you turn off the feature, unless otherwise specified in the Software or Services."}

{"data_shared" : "I may employ third-party companies and individuals due to the following reasons: To facilitate our Service; To provide the Service on our behalf; To perform Service-related services; or To assist us in analyzing how our Service is used. I want to inform users of this Service that these third parties have access to your Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.", 
"data_collected": "For a better experience, while using our Service, I may require you to provide us with certain personally identifiable information. The information that I request will be retained on your device and is not collected by me in any way. The app does use third party services that may collect information used to identify you. I want to inform you that whenever you use my Service, in a case of an error in the app I collect data and information (through third party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (“IP”) address, device name, operating system version, the configuration of the app when utilizing my Service, the time and date of your use of the Service, and other statistics.", 
"security_practices" : "I value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and I cannot guarantee its absolute security."}

{"data_shared" : "Information Shared with Our Advertising Partners. We may engage third-party advertising partners to collect information and serve advertising on and through the Services. These third-party advertising partners may collect information regarding your activities and your device (e.g., mobile device identifiers, page(s) visited, location, time of day) for the purposes of delivering personalized advertisements to you when you visit our Services and third-party services within their networks. Information Shared with Our Services Providers. We may engage third-party service providers to work with us to administer and provide the Services. The types of service providers to whom we entrust personal information include service providers for (i) the provision of the Services; (ii) the provision of information, products, and other services you have requested; (iii) analytics; (iv) marketing and advertising; (v) customer service activities; and (vi) the provision IT and related services. Software Development Kits. We may use third-party software development kits (SDKs) as part of the functionality of our App. SDKs may allow third parties including analytics and advertising partners to collect your information for various purposes including providing analytics services and personalized advertising.", 
"data_collected": "Information Provided by You or Collected with Your permission. Information Related to Your Use of the Services. Interactive Features. Surveys. Information about the device itself: IP address, device name, device type, device model, operation system, device GPS location. Information that can be used to access the App: Names, email address, phone number, country. Information about the internet connection: Network provider, network type, browser type. Others: Advertising ID, IMEI, OAID, IDFV, IDFA, GAID, zip code.", 
"security_practices" : "Pursue legitimate business interests, such as research and development (including marketing research), network and information security, and fraud prevention; Carry out analytics; Measure interest and engagement in the services; Develop of new products and services; Improve our products and Services; Ensure internal quality control and safety; Verify individual identity; Carry out audits; Communicate with you about activities on the Services and changes to our agreements; Prevent and prosecute potentially prohibited or illegal activities; Enforce our agreements; and Comply with our legal obligations."}

{"data_shared" : "We may also combine this information with other information collected online or offline about you, including information provided by third party sources, and it may be used or shared for the purposes described in this Privacy Statement. We may also allow third party advertising and personalization companies that we work with to use cookies on our website in order to develop personalized content and appropriate advertising based on your visits over time on GM websites and applications and non-GM websites and applications. This information may also be used to evaluate our online advertising campaigns or to tailor promotions and other marketing messages to you.", 
"data_collected": "Our Connected Services use cookies, web beacons, pixels and other device tracking technologies that allow us to identify you on your devices in a unique manner, such as through IP address or VIN (“cookies”), to gather information about your activity, such as demographic data, browser type, pages visited, activities conducted on the page, and the day and time of your visit. We use cookies, sometimes across devices, to measure your activity, remember your preferences, maximize and improve the performance of our Connected Services, and customize your experience (for example, maintaining your account login or contact information, helping you locate a nearby dealer, autofilling fields on forms). Similarly, we may also place cookies in our emails to measure the effectiveness of our email campaigns by identifying the individuals who open or act upon an email message, when an email message is opened, how many times an email message is forwarded, the type of software, device, operating system and browser used to open the email and any URL accessed through our email message.", 
"security_practices" : "GM adheres to the Digital Advertising Alliance's Self-Regulatory Principles for Online Behavioral Advertising. At this time, we do not honor “do not track” signals if enabled in a web browser. You may choose to decline or delete some or all of the cookies that we use on our websites; however, doing so may impair the functionality of our websites. Please refer to your browser for instructions to learn more about cookies and other technologies and how to manage their use. If you elect to refuse or delete cookies, you will need to repeat this process if you use another computer or device or change web browsers. If you choose to decline cookies, some of the functionality of a website may be impaired."}

{"data_shared" : "The app does use third-party services that may collect information used to identify you. This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. We may employ third-party companies and individuals due to the following reasons: To facilitate our Service; To provide the Service on our behalf; To perform Service-related services; or To assist us in analyzing how our Service is used. These third parties have access to their Personal Information.", 

"data_collected": "This App will collect installed applications, as follows: When accessing the file list, show the folder associated with the application; When accessing 'App Manager', display the list of installed applications; When cleaning up useless files, it is used to mark the source of useless files. We collect data and information (through third-party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (“IP”) address, device name, operating system version, the configuration of the app when utilizing our Service, the time and date of your use of the Service, and other statistics. The app may use third-party code and libraries that use 'cookies' to collect information and improve their services.", 

"security_practices" : "We value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security."}
